import {
    Avatar,
    Box,
    Button,
    Container,
    CssBaseline, Dialog, DialogActions, DialogContent, DialogContentText, DialogTitle,
    Grid,
    Input, TextField,
    Typography,
} from "@material-ui/core";
import { useState } from "react";
import {addUser} from "../Request/request";

export const Login = ({ setUser }) => {
    const [login, setLogin] = useState("");
    const [password, setPassword] = useState("");
    const [name, setName] = useState("");
    const [open, setOpen] = useState(false);
    const [item, setItem] = useState("");

    const handleInputName = (e) => {
        setItem(e.target.value);
    };

    const handleInputLog = (e) => {
        setItem(e.target.value);
    };

    const handleInputPass = (e) => {
        setItem(e.target.value);
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        const response = await fetch(
            `http://localhost:3000/users/?login=${login}&password=${password}`
        );
        const users = await response.json();
        if (users.length > 0) {
            setUser(users[0]);
            setLogin("");
            setPassword("");
        }
    };

    const handleclickOpen = () => {
        setOpen(true);
    };

    const handleClose = () => {
        setOpen(false);
    };

    const getNewUser = async () => {
        await addUser();
        // await fetch("http://localhost:3000/users", {
        //     method: "POST",
        //     headers: { "Content-Type": "application/json" },
        //     body: JSON.stringify({ name, login, password }),
        // });
        setOpen(false);
    };

    return (
            <Container component="main" maxWidth="xs">
                <CssBaseline />
                <Box
                    sx={{
                        marginTop: 8,
                        display: "flex",
                        flexDirection: "column",
                        alignItems: "center",
                    }}
                >
                    <Avatar sx={{ m: 1, bgcolor: "secondary.main" }}></Avatar>
                    <Typography component="h1" variant="h5">
                        Login in
                    </Typography>
                    <Box component="form" noValidate sx={{ mt: 1 }}>
                        <Input
                            margin="normal"
                            required
                            fullWidth
                            value={login}
                            autoFocus
                            onChange={handleInputLog}
                            placeholder="Login"
                        />
                        <Input
                            margin="normal"
                            required
                            fullWidth
                            placeholder="Password"
                            type="password"
                            value={password}
                            onChange={handleInputPass}
                        />
                        <Button
                            fullWidth
                            variant="contained"
                            color="primary"
                            onClick={handleSubmit}
                            sx={{ mt: 3, mb: 2 }}
                        >
                            Login In
                        </Button>
                        <Button
                            onClick={handleclickOpen}
                            fullWidth
                            variant="contained"
                            sx={{ mt: 3, mb: 2 }}
                        >
                            New User
                        </Button>
                        <Dialog
                            open={open}
                            onClose={handleClose}
                            aria-labelledby="form-dialog-title">
                            <DialogTitle id="form-dialog-title">Registration Form</DialogTitle>
                            <DialogContent>
                                <DialogContentText>
                                    Registration in users
                                </DialogContentText>
                                <TextField
                                    value={item}
                                    autoFocus
                                    margin="dense"
                                    id="name"
                                    label="Name"
                                    type="text"
                                    fullWidth
                                    onChange={handleInputName}
                                /><TextField
                                    value={item}
                                    autoFocus
                                    margin="dense"
                                    id="log"
                                    label="Login"
                                    type="email"
                                    fullWidth
                                    onChange={handleInputLog}
                                />
                                <TextField
                                    value={item}
                                    autoFocus
                                    margin="dense"
                                    id="pas"
                                    label="Password"
                                    type="password"
                                    fullWidth
                                    onChange={handleInputPass}
                                />
                            </DialogContent>
                            <DialogActions>
                                <Button onClick={handleClose} color="primary">Cancel</Button>
                                <Button onClick={getNewUser} color="primary">Log in</Button>
                            </DialogActions>
                        </Dialog>
                        <Grid container>
                            <Grid item></Grid>
                        </Grid>
                    </Box>
                </Box>
            </Container>
    );
};
